import React from 'react';

const Hero = () => {
  return (
    <section className="hero">
      {/* Property Logo */}
      <div className="property-logo">
        <img src="/img/property-logo.png" alt="Crownprince Logo" />
      </div>

      <div className="hero-content">
        <h1>Welcome to Crownprince Properties</h1>
        <p>Your trusted partner in growth.</p>
        <a href="#about" className="cta-btn">Learn More</a> {/* Link to #about */}
      </div>
    </section>
  );
}

export default Hero;
